export default function Gallery() 
{
    const item = {
        "galContentId" : "2586952",
        "galContentTypeId" : "17",
        "galTitle" : "서울빛초롱축제",
        "galWebImageUrl" : "http://tong.visitkorea.or.kr/cms2/website/52/2586952.jpg",
        "galCreatedtime" : "20190109152342",
        "galModifiedtime" : "20190109152354",
        "galPhotographyMonth" : "201811",
        "galPhotographyLocation" : "서울특별시 종로구",
        "galPhotographer" : "라이브스튜디오",
        "galSearchKeyword" : "서울빛초롱축제, 서울특별시 종로구, 2018 하반기 기획사진"
    };

  return (
    <div className="max-w-sm rounded overflow-hidden shadow-lg">
        <img className="h-48 w-full" src={item.galWebImageUrl.includes('http:') ? item.galWebImageUrl.replace('http:', 'https:') : item.galWebImageUrl} alt={item.galTitle}/>
    </div>
  )
}
